import React from 'react'

export default function Error() {
    return (
        <>
            <div style={{width: '100vw',height:'100vh',postion:'absolute',top:"0",zIndex:"1000",overflow:"hidden"}}>
                <h1>ERROR 404 :-: PAGE NOT FOUND</h1>
            </div>
        </>
    )
}
